import React from 'react';



export default function Tags({tags}) {
    return (
        <div className="tag_btn_group row">

            {
                tags.map((tag, index) => {
                    return (
                        <div key={index} className="col-md-12">
                            <button className='tag_btn'>{tag.label}</button>
                        </div>
                    )
                })
            }
        </div>


    )
}
